script: |
  super -f text -I q3526.spq | sort > q3526.out

inputs:
  - name: q3526.spq
    data: |
      SELECT DISTINCT - - col2 * - 76 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN col0 * col0 * - - col2 - + col2 AND + col1 + col0;
  - name: tab2

outputs:
  - name: q3526.out
    data: |
